import React from "react";

const NotFound = () => (
  <div className="jumbotron">
    <h1 className="display-4">Page non trouvée !</h1>
    <p className="lead">
      Cette page n'existe pas.
    </p>
    <p><a href="/">Retour à l'accueil</a></p>
  </div>
);

export default NotFound;
